import * as React from 'react';
import { useState } from "react"
import HeaderDeskTop from "./components/Header"
import Sider from "./components/Sider"
import Etusivu from "./components/Etusivu"
import Footer from "./components/Footer"
import Hyvinvointi from "./components/HyvinvointiPalvelut"
import Nettiajanvaraus from "./components/Nettiajanvaraus"
import EAH from "./components/Eah-koulutus"
import Hinnasto from "./components/Hinnasto"
import Yhteystiedot from "./components/Yhteystiedot"
import Tapahtumat from "./components/Tapahtumat"
import CV from "./components/CV"
import Kauppa from './components/Kauppa'
import Galleria from './components/Gallery';
import Tietosuoja from './components/Tietosuoja';
import {
   BrowserRouter as Router,
   Routes, Route, Link
 } from "react-router-dom"

function App(){
    const [page,setPage] = useState(Etusivu)
    function onClickEtusivu(){
       setPage(Etusivu)
    }
    function onClickHyvinvointi(){
        setPage(Hyvinvointi)
     }
     function onClickNettiajanvaraus(){
        setPage(Nettiajanvaraus)
     }
     function onClickEAH(){
        setPage(EAH)
     }
     function onClickHinnasto(){
        setPage(Hinnasto)
     }
     function onClickYhteystiedot(){
        setPage(Yhteystiedot)
     }
     function onClickTapahtumat(){
        setPage(Tapahtumat)
     }
     function onClickCV(){
      setPage(CV)
   }
   function onClickKauppa(){
      setPage(Kauppa)
   }
   function onClickGalleria(){
      setPage(Galleria)
   }
   function onClickTietosuoja(){
      setPage(Tietosuoja)
   }
    return(
      <Router>
         <HeaderDeskTop />
        <div className="container">
            <div className="main">
              <Routes path="/" element={<Etusivu />}  />
              <Routes path="hyvinvointi" element={<Hyvinvointi />}  />
              <Routes path="nettiajanvaraus" element={<Nettiajanvaraus />}  />
              <Routes path="eah" element={<EAH />}  />
              <Routes path="hinnasto" element={<Hinnasto />}  />
              <Routes path="yhteystiedot" element={<Yhteystiedot />}  />
              <Routes path="tapahtumat" element={<Tapahtumat />}  />
              <Routes path="cv" element={<CV />}  />
              <Routes path="kauppa" element={<Kauppa />}  />
              <Routes path="galleria" element={<Galleria />}  />
              <Routes path="tietosuoja" element={<Tietosuoja />}  />



            </div>
            <Sider></Sider>
            <Footer></Footer>
        </div>
</Router>
    )
}

export default App
